import React, { Component } from 'react';
import './App.css';
import icon from './covid_icon.png';

export class App extends Component {
  async componentDidMount() {
    const data = await fetch('api/home');
    console.log(data)
  }

  render() {
    return (
      <div style={{ display: 'flex', backgroundColor: '#fff', flexDirection: 'column' }}>

        <div style={{ display: 'flex', marginTop: 15, marginBottom: 15, marginLeft: 25, marginRight: 25, flexDirection: 'row', alignItems: 'center', justifyContent: 'space-between' }}>
          <div style={{ display: 'flex', flexDirection: 'row', flexDirection: 'row', alignItems: 'center', }}>
            <img style={{ height: 40, marginRight: 20 }} src={icon}/>
            <p style={{ fontSize: 18 }}>World Health State - COVID-19 Epidemic</p>
          </div>

          <p style={{ fontSize: 18, color: '#575757' }}>Beta v0.0.1</p>
        </div>
        <div style={{ width: '100%', height: 1, backgroundColor: '#acb'}}/>

        <div style={{ display: 'flex', alignSelf: 'center', alignItems: 'center', flexDirection: 'column', marginTop: 50, borderColor: '#c8c8c8', borderStyle: 'solid', borderRadius: 3, borderWidth: 1, width: '90%', height: 180, padding: 20 }}>
          <p style={{ fontWeight: 700, fontSize: 24 }}>Unofficial COVID-19 World Survey</p>
        </div>
      </div>
    );
  }
}
